    axios.get(url).then((response) => {
	  console.log(response.data);
	  while (response == null) {
		  if (response.data == true) {
			result = true
		  } else {
			result = false
		  }
	  }
    });
  }, []);
  
  return (
    <div>
	{response == null ? <div></div> : (result == false ? (<div>False</div>) : (<div><h3>True</h3></div>))}

